var PlainText = {};
PlainText.load = function() {

    ace.define('ace/snippets/plain_text', ['require', 'exports', 'module' ], function(require, exports, module) {


        exports.snippetText = "";
        exports.scope = "plain_text";

        });

};

//-------------------------------------------------------------------------------
// Exports
//-------------------------------------------------------------------------------

bugpack.export('acesnippets.PlainText', PlainText);